// };
class App extends Component{



  render(){
    const skus = Object.keys(this.props.products);
    const cards=skus.map(sku=>
      <Card  style={{height:"20%"}}>
        <Card.Img style={{width:210,height:300}} variant="top" src={this.props.products[sku].pic} />
        <Card.Body>
          <Card.Title style={{fontSize:0.5}}>{this.props.products[sku].title}</Card.Title>
          <Card.Text>
          {this.props.products[sku].price}
          </Card.Text>
        </Card.Body>
      </Card>

    )
    return <CardColumns style={{borderLeft:20,width:"85%",height:"80%",columnCount:4}}>{cards}</CardColumns>
  }

}

export default App;
